<pre><code class="lang-java">  public boolean autoReverse() {

    spinMotorBackwards();

    if ( frontLeftTalon.getSelectedSensorPosition() &lt;= ((Constants.ROTATIONAL_CONSTANT / 2) * -Constants.AUTO_DISTANCE_BACKWARDS)) {
      // frontLeftTalon.getSelectedSensorPosition() &gt;= 0  
      spinMotorBackwards();
      return true;
    } else {
      stopMotor();
      return false;
    }

  }
</code></pre>
